"131333":{"id":"131333","name":"DMC: O Mestre das Ilusões","slug":"dmc-o-mestre-das-ilusoes","original_title":"Beyond Magic with DMC","overview":"O mestre da ilusão Drummond Money-Coutts embarca em uma jornada internacional, explorando o emocionante e arriscado mundo de jogos de cartas inovadores e da mágica.","first_air_date":"2014-11-06","episode_run_time":44,"vote_average":4.3,"number_of_seasons":1,"number_of_episodes":7,"created_by":[],"production_companies":["So Shoot Me"],"genres":["Documentário","Reality"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/uhAwvJ2TIkmylTRioJAcbR88FOK.jpg","poster_path":"https://image.tmdb.org/t/p/original/ittCNIVvnx4k6bBxUh60SMuV6S6.jpg","cast":["Drummond Money-Coutts"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/ittCNIVvnx4k6bBxUh60SMuV6S6.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ittCNIVvnx4k6bBxUh60SMuV6S6.jpg","air_date":"2014-11-06","episode_count":7,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Atravessando Paredes","overview":"DMC explora o mundo da ilusão, onde a perspectiva e a percepção convergem para enganar o cérebro, levando-o a notar uma realidade alternativa: o que o olho percebe, o cérebro acredita.","air_date":"2014-11-06","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/dTEHQkBNU63T2QZYpvfAOHTzuG1.jpg","vote_average":0},"2":{"name":"Desafiando a Gravidade","overview":"DMC explora o mundo da mágica inspirado na Ásia. Sua jornada o leva a Cingapura, onde ele apresenta truques surpreendentes em homenagem aos grandes nomes da mágica asiática, antes de tentar uma homenagem excepcional e de cair o queixo em um show ao vivo.","air_date":"2014-11-13","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/d08j5uU29W5k3PEM0wsEnkYW6Lw.jpg","vote_average":0},"3":{"name":"Meio Mortal","overview":"Desta vez, DMC explora o mundo do mentalismo e como aparentes poderes sobrenaturais como a telecinesia, a telepatia e a premonição realizam alguns dos efeitos mais poderosos da magia.","air_date":"2014-11-20","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/wlWw3ZpAtVYFJ45h4tztAfaRMG3.jpg","vote_average":0},"4":{"name":"Dilacerado","overview":"Neste episódio, o mágico, ilusionista e ás das cartas Drummond Money-Coutts, tenta novamente um grande truque de escapologia que já quase o matou.","air_date":"2014-11-27","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/9yuvmg10HSj0Gw0N23s82TxLxjN.jpg","vote_average":0},"5":{"name":"Fogo Cruzado","overview":"Explore um elemento vital do repertório de qualquer mágico: o engano. Inspirando-se na execução da mágica no teatro de guerra, DMC prova que o que você vê nem sempre é o que você percebe, antes de seguir para um final de cair o queixo.","air_date":"2014-12-04","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/hh2v9IQ13wXL9fGYkV7geiqWLeg.jpg","vote_average":0},"6":{"name":"Homem em Chamas","overview":"DMC explora o mundo obscuro e muitas vezes perturbador da feitiçaria e bruxaria, que estão entre as formas mais antigas de magia.","air_date":"2014-12-11","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/vN9sWvXysVHSTXLwTKmiN7slQyB.jpg","vote_average":0},"7":{"name":"A Picada","overview":"DMC explora os mundos sobrepostos do mágico, do jogador e do trapaceiro: mundos repletos de controle, ganância e grandes emoções.","air_date":"2014-12-18","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/CDzv4LaACjjbl2mIy1bdhDAgpc.jpg","vote_average":0}}}}},
