"197591":{"id":"197591","name":"Franklin","slug":"franklin","original_title":"Franklin","overview":"Em dezembro de 1776, Benjamin Franklin já era mundialmente famoso por seus experimentos com eletricidade. Mas sua paixão e seu poder são postos à prova quando ele embarca para a França em uma missão secreta, com o destino da independência americana em jogo.","first_air_date":"2024-04-11","episode_run_time":0,"vote_average":7.9,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["ITV Studios America","EDEN Productions","Flame Ventures","Shadow Catcher Productions","Boil Some Water Entertainment"],"genres":["Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/wEEeWIrbcnUVxVRMR2dCKHAh8aM.jpg","poster_path":"https://image.tmdb.org/t/p/original/a9YV5QCdg95Zp02rKzkVxLxDtUC.jpg","cast":["Michael Douglas","Noah Jupe","Daniel Mays","Ludivine Sagnier","Thibault de Montalembert"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/a9YV5QCdg95Zp02rKzkVxLxDtUC.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/a9YV5QCdg95Zp02rKzkVxLxDtUC.jpg","air_date":"2024-04-11","episode_count":8,"overview":"N/A","vote_average":5,"episodes":{"1":{"name":"Tempero para as Orações","overview":"Enquanto a luta pela independência se aproxima de uma derrota iminente, Benjamin Franklin e seu neto mergulham em um mundo de intrigas e mentiras.","air_date":"2024-04-11","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/pyHTAPQqGJEOjuqHHDiqxDw56hO.jpg","vote_average":5},"2":{"name":"Bem-vindo, Danado","overview":"Uma operação de armas é ameaçada por um adversário implacável. A polícia de Paris acompanha cada passo de Franklin. Temple faz uma confissão.","air_date":"2024-04-11","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/tDXrjmwWrRrwVx0W3H2k3Klozua.jpg","vote_average":5},"3":{"name":"Orgulho e Gota","overview":"Más notícias chegam dos EUA. Franklin se vê envolvido nas armadilhas de Versalhes. Temple se curva diante de uma estrela.","air_date":"2024-04-11","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/apfr8EstPNZI94mCxT94oo7vzmt.jpg","vote_average":5},"4":{"name":"Leve Vingança","overview":"Franklin retribui um insulto e recebe o favor de um rei. Uma nova amante atrai a atenção dele, e um velho rival aparece para contrariá-lo.","air_date":"2024-04-18","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/kSUrpqKo0ZvqhmZqTktsxrNojUI.jpg","vote_average":5},"5":{"name":"O Estado Natural do Homem","overview":"A tensão aumenta entre Franklin e Adams. A Sra. Brillon exerce seu poder. Temple decide lutar a própria guerra.","air_date":"2024-04-25","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/3HSkvh91a4gcx1sAKuOM2vsXygE.jpg","vote_average":5},"6":{"name":"Beleza e Loucura","overview":"Franklin suspeita que haja traidores por todo lado. Vergennes faz uma oferta final. Jacques apresenta a Temple a emoção da caçada.","air_date":"2024-05-02","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/nHJ3Si4L9A6Mn9wosODax0Gqpqc.jpg","vote_average":5},"7":{"name":"Comece Rastejando","overview":"Após a vitória em Yorktown, americanos e franceses tramam uns contra os outros para levarem vantagem. Franklin fica acamado em um momento crucial.","air_date":"2024-05-09","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/9G4iM5VS2ZvcX6KX0kBSTZbx3sQ.jpg","vote_average":5},"8":{"name":"Pense em Três Coisas","overview":"O futuro dos Estados Unidos é decidido por seis homens em uma sala. Franklin e Temple enfrentam um mundo mudado.","air_date":"2024-05-16","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/yEpc5juIOshmITxb7UZNm9LLMf9.jpg","vote_average":5}}}}},
